import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Cookies from 'js-cookie';
import {
    Container,
    Card,
    Badge,
    Accordion,
    Alert,
    Spinner
} from 'react-bootstrap';
import Header from './Header';

const MappingsList = () => {
    const [mappings, setMappings] = useState([]);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);
    const [uploadError, setUploadError] = useState(null);

    // Get selected URL from cookie or use default
    const getInitialUrl = () => {
        const savedUrl = Cookies.get('selectedWireMockUrl');
        if (savedUrl) {
            try {
                return JSON.parse(savedUrl);
            } catch (e) {
                console.error('Error parsing saved URL:', e);
            }
        }
        const defaultEnv = process.env.REACT_APP_WIREMOCK_URL_1;
        if (defaultEnv) {
            const [name, url] = defaultEnv.split('|');
            return { id: 1, name: name.trim(), url: url.trim() };
        }
        return { id: 1, name: 'Default', url: 'https://wiremock.stage.exite.net/__admin/requests' };
    };

    const [selectedWireMockUrl, setSelectedWireMockUrl] = useState(getInitialUrl());

    // Fetch mappings from WireMock API
    const fetchMappings = async () => {
        setLoading(true);
        setError(null);
        try {
            // Replace /requests with /mappings in the URL
            const mappingsUrl = selectedWireMockUrl.url.replace('/__admin/requests', '/__admin/mappings');
            const response = await axios.get(mappingsUrl);
            setMappings(response.data.mappings || []);
        } catch (err) {
            setError('Failed to fetch mappings: ' + err.message);
            console.error('Error fetching mappings:', err);
        } finally {
            setLoading(false);
        }
    };

    // Clear mappings from WireMock
    const clearMappings = async () => {
        setLoading(true);
        setError(null);
        try {
            const mappingsUrl = selectedWireMockUrl.url.replace('/__admin/requests', '/__admin/mappings');
            await axios.delete(mappingsUrl);
            setMappings([]);
        } catch (err) {
            setError('Failed to clear mappings: ' + err.message);
            console.error('Error clearing mappings:', err);
        } finally {
            setLoading(false);
        }
    };

    // Fetch data on component mount
    useEffect(() => {
        fetchMappings();
    }, []);

    // Refetch when URL changes
    useEffect(() => {
        if (selectedWireMockUrl?.url) {
            fetchMappings();
        }
    }, [selectedWireMockUrl]);

    // Handle URL selection change
    const handleUrlChange = (newUrl) => {
        setSelectedWireMockUrl(newUrl);
    };

    // Pretty print JSON
    const prettyPrintJson = (obj) => {
        try {
            return JSON.stringify(obj, null, 2);
        } catch (e) {
            return JSON.stringify(obj);
        }
    };

    return (
        <Container fluid className="py-2">
            {/* Header */}
            <Row className="mb-3">
                <Col>
                    <div className="d-flex align-items-center justify-content-between">
                        <div>
                            <h2 className="mb-0">
                                <i className="bi bi-diagram-3 me-2"></i>
                                Stub Mappings
                                <Badge bg="secondary" className="ms-3">{mappings.length} mappings</Badge>
                            </h2>
                        </div>
                        <Button 
                            variant="primary" 
                            onClick={fetchMappings}
                            disabled={loading}
                            size="sm"
                        >
                            <i className="bi bi-arrow-clockwise me-2"></i>
                            {loading ? 'Refreshing...' : 'Refresh'}
                        </Button>
                    </div>
                </Col>
            </Row>

            {/* Error Alert */}
            {error && (
                <Alert variant="danger" dismissible onClose={() => setError(null)}>
                    {error}
                </Alert>
            )}

            {/* Loading Spinner */}
            {loading ? (
                <div className="text-center py-5">
                    <Spinner animation="border" role="status" variant="primary">
                        <span className="visually-hidden">Loading...</span>
                    </Spinner>
                    <p className="mt-2 text-muted">Fetching mappings from WireMock...</p>
                </div>
            ) : mappings.length === 0 ? (
                <Alert variant="info">
                    <Alert.Heading>No mappings found</Alert.Heading>
                    <p>There are no stub mappings configured in this WireMock instance.</p>
                </Alert>
            ) : (
                <Accordion>
                    {mappings.map((mapping, index) => (
                        <Card key={mapping.id || index} className="mb-2 shadow-sm">
                            <Accordion.Item eventKey={mapping.id || index.toString()}>
                                <Accordion.Header>
                                    <Container fluid>
                                        <Row className="w-100 align-items-center g-2">
                                            <Col xs={12} md={2}>
                                                <Badge bg="primary">
                                                    {mapping.request?.method || 'ANY'}
                                                </Badge>
                                            </Col>
                                            <Col xs={12} md={6}>
                                                <code className="text-break">
                                                    {mapping.request?.urlPattern || mapping.request?.url || mapping.request?.urlPath || 'N/A'}
                                                </code>
                                            </Col>
                                            <Col xs={6} md={2}>
                                                <Badge bg="success">
                                                    Status: {mapping.response?.status || 200}
                                                </Badge>
                                            </Col>
                                            <Col xs={6} md={2}>
                                                {mapping.metadata?.name && (
                                                    <small className="text-muted">{mapping.metadata.name}</small>
                                                )}
                                            </Col>
                                        </Row>
                                    </Container>
                                </Accordion.Header>
                                <Accordion.Body className="py-2">
                                    <Card className="mb-2">
                                        <Card.Header className="bg-light py-1">
                                            <strong><i className="bi bi-info-circle me-2"></i>Mapping Details</strong>
                                        </Card.Header>
                                        <Card.Body className="py-2">
                                            <Row className="mb-2">
                                                <Col md={6}>
                                                    <p className="mb-1">
                                                        <strong>ID:</strong> <code>{mapping.id}</code>
                                                    </p>
                                                    {mapping.uuid && (
                                                        <p className="mb-1">
                                                            <strong>UUID:</strong> <code>{mapping.uuid}</code>
                                                        </p>
                                                    )}
                                                    <p className="mb-1">
                                                        <strong>Priority:</strong> {mapping.priority || 'Default'}
                                                    </p>
                                                </Col>
                                                <Col md={6}>
                                                    {mapping.metadata?.name && (
                                                        <p className="mb-1">
                                                            <strong>Name:</strong> {mapping.metadata.name}
                                                        </p>
                                                    )}
                                                    <p className="mb-1">
                                                        <strong>Persistent:</strong> {mapping.persistent ? '✓ Yes' : '✗ No'}
                                                    </p>
                                                </Col>
                                            </Row>

                                            {/* Request Matching */}
                                            <div className="mt-3 bg-light p-2">
                                                <strong className='text-muted'><i className="bi bi-funnel me-2"></i>Request Matching</strong>
                                                <pre className="bg-white p-2 rounded mb-0 mt-2" style={{ maxHeight: '300px', overflow: 'auto', fontSize: '12px' }}>
                                                    <code>{prettyPrintJson(mapping.request)}</code>
                                                </pre>
                                            </div>

                                            {/* Response Definition */}
                                            <div className="mt-3 bg-light p-2">
                                                <strong className='text-muted'><i className="bi bi-reply me-2"></i>Response Definition</strong>
                                                <pre className="bg-white p-2 rounded mb-0 mt-2" style={{ maxHeight: '300px', overflow: 'auto', fontSize: '12px' }}>
                                                    <code>{prettyPrintJson(mapping.response)}</code>
                                                </pre>
                                            </div>
                                        </Card.Body>
                                    </Card>
                                </Accordion.Body>
                            </Accordion.Item>
                        </Card>
                    ))}
                </Accordion>
            )}
        </Container>
    );
};

export default MappingsList;
